import React, { useState } from 'react';
import './sidenavigation.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';


import { a } from 'react-router-dom';

const Sidebar = () => {
  const [show, setShow] = useState(false);

  return (
    <main className={show ? 'space-toggle' : null}>
      <header className={`header ${show ? 'space-toggle' : null}`}>
        <div className='header-toggle' onClick={() => setShow(!show)}>
        <FontAwesomeIcon icon={faBars} /> 
        {/* <FontAwesomeIcon icon="fa-solid fa-bars " /> */}
          {/* <i className={`fas fa-bars ${show ? 'fa-solid fa-xmark' : null}`}></i> */}
        </div>
      </header>

      <aside className={`sidebar ${show ? 'show' : null}`}>
        <nav className='nav'>
          <div>
            <a className='nav-logo'>
              <i className={`fas fa-home-alt nav-logo-icon`}></i>
              <span className='nav-logo-name'>Homepage</span>
            </a>

            <div className='nav-list'>
              <a to='/dashboard' className='nav-a active'>
                <i className='fas fa-tachometer-alt nav-a-icon'></i>
                <span className='nav-a-name'>Dashboard</span>
              </a>
              <a to='/hotel' className='nav-a'>
                <i className='fas fa-hotel nav-a-icon'></i>
                <span className='nav-a-name'>Hotel</span>
              </a>
              <a to='/gallery' className='nav-a'>
                <i className='fas fa-image nav-a-icon'></i>
                <span className='nav-a-name'>Gallery</span>
              </a>
              <a to='/gallery' className='nav-a'>
                <i className='fas fa-dollar-sign nav-a-icon'></i>
                <span className='nav-a-name'>Transaction</span>
              </a>
            </div>
          </div>

          <a className='nav-a'>
            <i className='fas fa-sign-out nav-a-icon'></i>
            <span className='nav-a-name'>Logout</span>
          </a>
        </nav>
      </aside>

      <h1>Content</h1>
    </main>
  );
};

export default Sidebar;
